import React from 'react';
import ExperienceLeft from './ExperienceLeft';
import ExperienceRight from './ExperienceRight';
import experienceData from '../Data/ExperienceData';

class Experience extends React.Component {
  state = {
    experienceData
  };

  render() {
    const experienceDates = this.state.experienceData.map(item => (
      <ExperienceLeft key={item.id} year={item.year} months={item.months} />
    ));
    const experienceContent = this.state.experienceData.map(item => (
      <ExperienceRight
        key={item.id}
        company={item.company}
        location={item.location}
        role={item.role}
        descriptions={item.descriptions}
        logo={item.logo}
      />
    ));

    return (
      <div className="experience" id="experience">
        <div className="container">
          <div className="experience-word">
            <h2>Experience</h2>
          </div>
          <div className="content">
            <div className="experience-left">{experienceDates}</div>
            <div className="experience-right">{experienceContent}</div>
          </div>
        </div>
      </div>
    );
  }
}

export default Experience;
